import { Fragment } from "react";

import Card from "../UI/Card/Card";
import image1 from "../../assets/images/20220619_191909.jpg";
import image2 from "../../assets/images/20220627_231841.jpg";
import image3 from "../../assets/images/IMG-20230102-WA0005.jpg";
import image4 from "../../assets/images/20220817_221124.jpg";
import classes from "./BodyImages.module.css";

const BodyImages = () => {
  return (
    <Fragment>
      <div className={classes.images}>
        <Card>
          <div className={classes.inner}>
            <div className={classes.front}>
              <img src={image1} alt="Ethan holding a dog"></img>
            </div>
            <div className={classes.back}></div>
          </div>
        </Card>
        <Card>
          <img src={image2} alt="Ethan holding a juice box"></img>
        </Card>
        <Card>
          <img src={image3} alt="Ethan holding a juice box"></img>
        </Card>
        <Card>
          <img src={image4} alt="Ethan holding a juice box"></img>
        </Card>
        <Card>
          <img src={image4} alt="Ethan holding a juice box"></img>
        </Card>
      </div>
    </Fragment>
  );
};

export default BodyImages;
